import './App.css';
import  {useState} from 'react'
import React from 'react';
//import axios from "axios";
import {FormLabel,Box,Input,HStack,FormControl,Center,RadioGroup,Radio,} from "@chakra-ui/react";
//import Rad from './button';

const App = () => {
  const [value, setValue] = React.useState('Masculino')
  //const [name, setName] = useState('');
 // const [idade, setIdade] = useState('');
 // const [email, setEmail] = useState('');


 const handleSexoChange = (newValue) => {
  setValue(newValue);
};
  /*function btnFunction() {
    axios.post('http://localhost:8000/forms', {
      //name,

    })
      .then(response => {
        console.log(response);
      })
      .catch(error => {
        console.log(error);
      });
  }*/

  return (
    <div className="container">
    <div className="container-login">
    <div className="wrap-login">
       <form >

      <Center
                as="header"
                h={50}
                w={430}
                bg="#f29ef3"
                color="white"
                fontWeight="bold"
                fontSize="4xl"
                pb="8"
              >
                <h2>Formulário</h2>
              </Center><br></br>
      <FormControl display="flex" flexDir="column" gap="4">
      <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="nome">Nome Completo</FormLabel>
                <Input id="nome" type="nome" />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="cpf">Cpf</FormLabel>
                <Input id="cpf" />
              </Box>
            </HStack>
      <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="nasc">Data de Nascimento</FormLabel>
                <Input id="nasc" type="date" />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="natural">Naturalidade</FormLabel>
                <Input id="natural" />
              </Box>
            </HStack>
            <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="cel">Celular</FormLabel>
                <Input id="cel" type="number" />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="Tefone">Telefone</FormLabel>
                <Input id="Tefone" type="number" />
              </Box>
            </HStack>
            <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="endereco">Endereço</FormLabel>
                <Input id="endereco" />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="cidade">Cidade</FormLabel>
                <Input id="cidade" />
              </Box>
            </HStack>
            <HStack spacing="4">
              <Box w="100%">
                <FormLabel>Sexo</FormLabel>
                <RadioGroup onChange={handleSexoChange} 
                value={value} defaultValue="Masculino">
                  <HStack spacing="24px">
                    <Radio value="Masculino">Masculino</Radio>
                    <Radio value="Feminino">Feminino</Radio>
                    <Radio value="Outro">Outro</Radio>
                  </HStack>
                </RadioGroup>
              </Box>
            </HStack>
      </FormControl>




      </form>
      <div>
      <div className="container-login-form-btn">
            <button type="submit" className="login-form-btn">Entrar</button>

            </div>

      </div>
    </div>
    </div>
    </div>
  );
};

export default App;
